import React from 'react'
import { StyleSheet, Text, View } from 'react-native'

export function Card(props: any) {
    return (
        <View  style={[styles.card, props.style]}>
            {props.children}
        </View>
    )
}

const styles = StyleSheet.create({
    card: {
        borderRadius: 5,
        backgroundColor: '#FFFFFF',
        flexDirection:'row',
        padding: 5,
        shadowColor: '#000000',
        shadowOpacity: 0.05,
        shadowRadius: 15,
        fontFamily: "Roboto"

    }
})
